  useEffect(() => {
    // Make an HTTP request to your NestJS endpoint
    axios.get('http://your-nestjs-server/auth/google/callback')
      .then(response => {
        // Handle the response based on the status or data received
        if (response.status === 200) {
          window.location.href = response.data.redirectURL; // Redirect based on data received
        } else {
          // Handle other status codes or errors
        }
      })
      .catch(error => {
        // Handle errors
        console.error('Error:', error);
      });
  }, []);

  return (
    // Your React component JSX
    <div>
      {/* Your component content */}
    </div>
  );
};

export default YourComponent;

